    TResult? Function(_ChangeContainerSizeAndOpacity value)?
        changeContainerSizeAndOpacity,
    TResult? Function(_Completed value)? completed,
  }) {
    return completed?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(_Initial value)? initial,
    TResult Function(_ChangeTextOpacity value)? changeTextOpacity,
    TResult Function(_ChangeFontSize value)? changeFontSize,
    TResult Function(_ChangeContainerSizeAndOpacity value)?
        changeContainerSizeAndOpacity,
    TResult Function(_Completed value)? completed,
    required TResult orElse(),
  }) {
    if (completed != null) {
      return completed(this);
    }
    return orElse();
  }
}

abstract class _Completed implements AnimationSplashState {
  const factory _Completed() = _$CompletedImpl;
}
